// src/App.js

import React, { useEffect, useState } from "react";
import { login, getDoctorList } from "./apiService";

function App() {
  const [doctors, setDoctors] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const token = await login("yourUsername", "yourPassword"); // Replace with test creds
        const doctorData = await getDoctorList(token);
        setDoctors(doctorData?.data || []);
      } catch (error) {
        console.error("Error during doctor fetch:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchDoctors();
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h2>Doctor List</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <ul>
          {doctors.map((doc, index) => (
            <li key={index}>{doc.name}</li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default App;
